import React, { Component } from 'react';
//import './App.css';
import General from './components/General'; 
//import SearchPage from '.components/SearchPage';
import {Container} from 'react-bootstrap';
import { Button } from 'react-bootstrap';
import { ButtonToolbar } from 'react-bootstrap';
import Navbar from 'react-bootstrap/Navbar'
import { Form } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
import Login from './components/Login';
import SearchPage from './components/SearchPage';
class App extends Component {
   constructor(props){
     super(props)
     this.state = {
       currentPage : <header/>,
       userName: '',
       userPassword: ''
     }
    this.handleClick = this.handleClick.bind(this);
   }
   componentWillMount(){
     this.setState({ currentPage:
      <Form>
    <Form.Group controlId="formBasicEmail">
    <Form.Label>User Name: </Form.Label>
    <Form.Control type="text" placeholder="Enter User Name" />
    <Form.Text className="text-muted">
      We'll never share your email with anyone else.
    </Form.Text>
  </Form.Group>

  <Form.Group controlId="formBasicPassword">
    <Form.Label>Password</Form.Label>
    <Form.Control type="password" placeholder="Password" />
  </Form.Group>
  <Button variant="primary" type="submit" onClick = {this.handleClick}> 
    Submit
  </Button>
  </Form>

     });
   }
  handleClick(event){
    if(event.target.name == "insert"){
      this.state.currentPage = <General/>;
      this.forceUpdate();
    }
    if(event.target.name == "search"){
      this.state.currentPage = <SearchPage/>;
      this.forceUpdate();
    }
    if(event.target.name == "login"){
      this.state.currentPage = <Login/>;
      this.forceUpdate();
    }
  }




  render() {

    return (

      <div className="App" >
          <Container>
          <Navbar collapseOnSelect expand='lg' bg= 'light' variant= 'green' >
         <Navbar.Brand expand = "lg" bg = "gray" >{this.state.currentUser} loggedin</Navbar.Brand>
         <hr></hr>
          <Button onClick = {this.handleClick} variant="outline-primary" size = "lg" bg= "blue" name="insert">Insert A Report </Button>
          <hr></hr>
          <Button  onClick = {this.handleClick}  variant="outline-primary"  size = "lg" bg = "blue" name = "search">See Search Options</Button>
          <hr></hr>
          <Button onClick = {this.handleClick} variant="outline-primary" size = "lg" bg= "blue" name="login">Login</Button>
          <hr></hr>
        </Navbar>
       {this.state.currentPage}
          </Container>
      </div>
    );
  }
}



export default App;
